import Container from '../components/container';

function Index(gifs) {
  return (
    <Container>
      {gifs.map((gif) => {
        <li>{gif.url}</li>;
      })}
    </Container>
  );
}

async function getStaticProps() {
  const apiKey = 'MABWKnnDnZ9l8dALV6HfxnH1DVYpoX1J';
  const res = await fetch(
    `http://api.giphy.com/v1/gifs/search?q=ryan+gosling&api_key=${apiKey}&limit=5`
  );
  const gifs = await res.json();

  console.log(gifs);

  return {
    props: {
      gifs,
    },
  };
}

export default Index;
